import { useSelector } from 'react-redux';
import WinnerGraphBar from './WinnerGraphBar';

const WinnerGraph = () => {
  const winners = useSelector(({ quiz }) => quiz.results).slice(0, 3);

  return (
    <div className="m-winner-graph">
      {winners.map(winner => (
        <WinnerGraphBar
          name={winner._id}
          score={winner.score}
          questionsRight={winner.questionsRight}
        />
      ))}
    </div>
  );
};

export default WinnerGraph;
